 CREATE PROCEDURE [dbo].[Acc_Head_Get_SP](
 @AccHeadId bigint=null,
 @AccHeadKey nvarchar(40)=null,
 @AccHeadName nvarchar(100)=null,

 @page_number INT = 1,
 @page_size INT =10
 )
AS

 BEGIN 
      SET NOCOUNT ON;
      SET TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;

		-- Check if @unitName already exists (case-insensitive, trimmed, and with white spaces replaced)
		IF EXISTS (
			SELECT 1
			FROM [Acc].[AccHeads]  
			WHERE
			Status='Active' and

			LOWER(LTRIM(RTRIM(REPLACE([AccHeadName], ' ', '')))) = LOWER(LTRIM(RTRIM(REPLACE(@AccHeadName, ' ', ''))))
		)
		BEGIN
			-- If @unitName already exists, set @unitId to -1
			SET @AccHeadId = -1;
		END
       ELSE
         BEGIN
			-- Insert new record
			INSERT INTO [Acc].[AccHeads] (
				[AccHeadKey],  

				[AccHeadName],
				[EntryDateTime],
				[EntryBy],
				[LastModifyDate],
				[LastModifyBy],
				[DeletedDate],
				[DeletedBy],
				[Status]
			) 
			VALUES (
				NEWID(),  

				@AccHeadName,
				@entryDateTime,
				@entryBy,
				@lastModifyDate,
				@lastModifyBy,
				@deletedDate,
				@deletedBy,
				@status
			);

			-- Get the unitId of the newly inserted record
			SET @AccHeadId= SCOPE_IDENTITY();
		END

-- Return the @unitId value
SELECT @AccHeadId AS unitId;
END;

