CREATE PROCEDURE [dbo].[Meeting_Minutes _Details_Save_SP](
@meetng_Mnts_Dtls_ID INT,
@fk_Srvc_Id          INT,
@quantity            DECIMAL(10, 0),
@unit                NVARCHAR(50) = NULL)
AS

BEGIN SET nocount ON SET TRANSACTION isolation level READ uncommitted;
WITH CTE AS ( SELECT a.[ProdSubCtgId] ,a.[ProdSubCtgKey] ,a.[BranchId] ,a.[ProdCtgId] ,a.[ProdSubCtgName] ,a.[EntryDateTime] ,a.[EntryBy] ,a.[LastModifyDate] ,a.[LastModifyBy] ,a.[DeletedDate] ,a.[DeletedBy] ,a.[Status] ,ROW_NUMBER() OVER (ORDER BY a.ProdSubCtgId ASC) AS RowNum FROM [invnt].[ProductSubCategories] a WHERE (@ProdSubCtgId IS NULL OR a.ProdSubCtgId = @ProdSubCtgId) and (@ProdSubCtgKey IS NULL OR a.ProdSubCtgKey = @ProdSubCtgKey) and (@BranchId IS NULL OR a.BranchId = @BranchId) and (@ProdCtgId IS NULL OR a.ProdCtgId = @ProdCtgId) and (@ProdSubCtgName IS NULL OR a.ProdSubCtgName = @ProdSubCtgName) and a.Status='Active' )
SELECT a.*, (SELECT COUNT(*) FROM CTE) AS total_row FROM CTE a WHERE RowNum > ((@PageNumber - 1) * @PageSize) AND RowNum <= (@PageNumber * @PageSize) ORDER BY a.ProdSubCtgId DESC; END

  Create PROCEDURE [dbo].[Prdct_Sub_Ctg_Get_SP](
 @ProdSubCtgId bigint=null,
 @ProdSubCtgKey nvarchar(40)=null,
 @BranchId bigint,
 @ProdCtgId bigint,
 @ProdSubCtgName nvarchar(100), 
 @PageNumber INT = 1,
 @PageSize INT =10
 )
AS

BEGIN SET NOCOUNT ON; SET TRANSACTION ISOLATION LEVEL READ UNCOMMITTED;
-- Check if @unitName already exists (case-insensitive, trimmed, and with white spaces replaced) IF EXISTS ( SELECT 1 FROM [invnt].[ProductSubCategories] WHERE Status='Active' and @ProdSubCtgId=0 and LOWER(LTRIM(RTRIM(REPLACE([ProdSubCtgName], ' ', '')))) = LOWER(LTRIM(RTRIM(REPLACE(@ProdSubCtgName, ' ', '')))) ) BEGIN -- If BillingPlanName already exists, set @BillingPlanId to -1 SET @SuccessOrFailId =-1; END ELSE BEGIN IF(@ProdSubCtgId=0) Begin -- Insert new record INSERT INTO [invnt].[ProductSubCategories] ( [ProdSubCtgKey] ,[BranchId] ,[ProdCtgId] ,[ProdSubCtgName] ,[EntryDateTime] ,[EntryBy] ,[LastModifyDate] ,[LastModifyBy] ,[DeletedDate] ,[DeletedBy] ,[Status] ) VALUES ( NEWID(), @BranchId, @ProdCtgId, @ProdSubCtgName, @EntryDateTime, @EntryBy, @LastModifyDate, @LastModifyBy, @DeletedDate, @DeletedBy, 'Active' ); SET @SuccessOrFailId = SCOPE_IDENTITY(); --Get Newly Created Id -- SELECT @BillingPlanId AS BillingPlanId; --Set Newly Created Id
End Else BEGIN TRY --try start for update UPDATE a WITH(ROWLOCK) SET [BranchId]= @BranchId, [ProdCtgId]= @ProdCtgId, [ProdSubCtgName] = @ProdSubCtgName, [LastModifyDate] = COALESCE(@lastModifyDate, [LastModifyDate]), [LastModifyBy] = COALESCE(@lastModifyBy, [LastModifyBy]), [DeletedDate] = COALESCE(@deletedDate, [DeletedDate]), [DeletedBy] = COALESCE(@deletedBy, [DeletedBy]), [Status] = COALESCE(@status, [Status]) FROM [invnt].[ProductSubCategories] a WITH(ROWLOCK) WHERE a.ProdSubCtgId = @ProdSubCtgId
SET @SuccessOrFailId = @ProdSubCtgId; -- Set success flag updated Id END TRY BEGIN CATCH SET @SuccessOrFailId = 0; -- Error occurred, set success flag to 0 END CATCH END
END;
